00221     XTREE_NODE_ITERATOR<T>&           operator ++             ()
00222                                       {
00223                                         // put the current' nodes children on the stack, and
00224                                         // then move onto the next one by popping it
00225                                         // off the stack and making it the current one
00226                                         if(current)
00227                                           {
00228                                             for( int i = current->GetNChildren()-1; i>=0 ; i--)
00229                                               {
00230                                                 stack.Push(current->GetChild(i));
00231                                               }
00232                                           }
00233 
00234                                         if(!stack.IsEmpty())
00235                                           {
00236                                             current = stack.Top();
00237                                             stack.Pop();
00238                                           }
00239                                           else
00240                                           {
00241                                             (*this) = tree->End();
00242                                           }
00243 
00244                                         return (*this);
00245                                       }
00246 
00247                                       operator bool           ()                              { return (current != NULL);                                 }
00248 
00249 
00250     const XTREE_NODE_ITERATOR<T>&     operator =              (const XTREE_NODE_ITERATOR<T>& iterator)
00251                                       {
00252                                         this->tree    = iterator.tree;
00253                                         this->current = iterator.current;
00254 
00255                                         while(!stack.IsEmpty())
00256                                           {
00257                                             stack.Pop();
00258                                           }
00259 
00260                                         XTREE_NODE_ITERATOR<T>&   it        = const_cast <XTREE_NODE_ITERATOR<T>&>(iterator);   // remove const-ness
00261                                         int                       stacksize = it.GetStack()->GetSize();
00262                                         XVECTOR<XTREE_NODE<T>*>   vtree(stacksize);
00263 
00264                                         while(!it.stack.IsEmpty())
00265                                           {
00266                                             vtree.Add(it.stack.Top());
00267                                             it.stack.Pop();
00268                                           }
00269 
00270                                         // now fill both stacks from the vector (traverse from back)
00271                                         for(int i=vtree.GetSize()-1; i>=0; i--)
00272                                           {
00273                                             it.stack.Push(vtree.Get(i));
00274                                             stack.Push(vtree.Get(i));
00275                                           }
00276 
00277                                         return (*this);
00278                                       }
